import * as React from 'react';
import { DemoContainer, DemoItem } from '@mui/x-date-pickers/internals/demo';
import { AdapterDayjs } from '@mui/x-date-pickers/AdapterDayjs';
import { LocalizationProvider } from '@mui/x-date-pickers/LocalizationProvider';
import { DatePicker } from '@mui/x-date-pickers/DatePicker';
import { TimePicker } from '@mui/x-date-pickers/TimePicker';
import Stack from 'stack';
import { Button, Tooltip, styled } from '@material-ui/core';
import { useState } from 'react';
import { DateCalendar, TimeField } from '@mui/x-date-pickers';

const ProSpan = styled('span')({
  display: 'inline-block',
  height: '1em',
  width: '1em',
  verticalAlign: 'middle',
  marginLeft: '0.3em',
  marginBottom: '0.08em',
  backgroundSize: 'contain',
  backgroundRepeat: 'no-repeat',
  backgroundImage: 'url(https://mui.com/static/x/pro.svg)',
});

function Label({ componentName, valueType, isProOnly }) {
  const content = (
    <span>
      <strong>{componentName}</strong> for {valueType} editing
    </span>
  );

  if (isProOnly) {
    return (
      <Stack direction="row" spacing={0.5} component="span">
        <Tooltip title="Included on Pro package">
          <a href="https://mui.com/x/introduction/licensing/#pro-plan">
            <ProSpan />
          </a>
        </Tooltip>
        {content}
      </Stack>
    );
  }

  return content;
}

export default function Agenda({ aoEnviar }) {
  const [data, setData] = useState('');
  const [hora, setHora] = useState('');

  const handleDataChange = (selectedDate) => {
    setData(selectedDate);
  };

  const handleHoraChange = (selectedTime) => {
    setHora(selectedTime);
  };

  const handleSubmit = (event) => {
    event.preventDefault();
    aoEnviar({ data, hora });
  };

  return (
    <LocalizationProvider dateAdapter={AdapterDayjs}>
      <DemoContainer components={['DatePicker', 'TimePicker']}>
        <form     
        onSubmit={(event) => {
        event.preventDefault();
        // if (possoEnviar()) {
          aoEnviar({ data, hora });
        // }
        }}>
          {/* <DemoItem label={<Label componentName="Data do Agendamento" valueType="date" />}>
            <DateCalendar      
              value={data}
              onChange={(event) => {
                setData(event);
              }} 
            />
          </DemoItem> */}
          <DemoItem label="readOnly">
            <DateCalendar defaultValue={dayjs('2022-04-17')} readOnly />
          </DemoItem>
          <DemoItem label={<Label componentName="Horas do Agendamento" valueType="time" />}>
            <TimeField
              value={hora}
              onChange={(event) => {
                setHora(event);
              }} 
            />
          </DemoItem>
          <Button type="submit" variant="contained" color="primary" fullWidth>
            Finalizar Cadastro
          </Button>
        </form>
      </DemoContainer>
    </LocalizationProvider>
  );
}
